import React from "react";
import "./Subject.css";

function Subject({info, index, toggleSubject}){

    return(
        <div className={"subject "+ (info.open ? "open": "")}
            key={index}
             onClick={()=>toggleSubject(index)}
        >
            <div className={"subject__heading"}>
                {info.subject}
            </div>
            <div className={"subject__topics"}>
                {
                    info.chapters.map((chapter, i) =>{
                        return(
                            <div>
                                {chapter}
                            </div>
                        );
                    })
                }
            </div>
        </div>
    );
}
export default Subject;
